import { Box, Center } from '@chakra-ui/react';
import React, { useEffect } from 'react';

import GitHubCalendar from 'react-github-calendar';




const Calendar = () => {
 
  return (
    <Center>
      <GitHubCalendar m="auto" username= "K" responsive={true} />
    </Center>
       
   
  );
};

export default Calendar;
